import React from "react";

function FileDetails({ file, onClose, onDelete }) {
  return (
    <div className="absolute top-0 left-0 w-full h-full bg-gray-900 bg-opacity-50 flex items-center justify-center">
      <div className="bg-white p-5 rounded-lg">
        <h2 className="text-xl font-bold">{file.name}</h2>
        <p>Path: {file.path}</p>
        <div className="flex space-x-4 mt-4">
          <button onClick={() => onDelete(file.id)} className="bg-red-500 hover:bg-red-700 text-white font-bold py-2 px-4 rounded">
            Delete
          </button>
          <button onClick={() => onDownload(file)} className="bg-green-500 hover:bg-green-700 text-white font-bold py-2 px-4 rounded">
          Download
        </button>


          <button onClick={onClose} className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
            Close
          </button>
        </div>
      </div>
    </div>
  );
}

export default FileDetails;
